jQuery.fn.poprawnyNrRejestracyjny = function() {
    var $input = $(this[0]);
    $input.keypress(function(evt){
        var theEvent = evt || window.event;
        var key = theEvent.keyCode || theEvent.which;
        if ( theEvent.key === 'Right' || theEvent.key === 'Left' || theEvent.key === 'Tab'|| theEvent.key === 'Del' ) { return; }
        key = String.fromCharCode( key );
        var regex = /[\t\b0-9a-zA-Z]/;
        if( !regex.test(key) ) {
          if(theEvent.preventDefault) theEvent.preventDefault();
        }
    });
    $input.change(function(evt){
        var theEvent = evt || window.event;
        var val = $(this).val().replace(/[^0-9a-zA-Z]/g, '');
        $(this).val(val);
        var regex = /^[0-9a-zA-Z]{1,9}$/;
        if( !regex.test(val) ) {
          $(this).val('');
          if(theEvent.preventDefault) theEvent.preventDefault();
        }
    });
};

