function GdzieZnajde( co,event ) {
    if ( $('.pop-up').is(":visible") ){
            if($('.pop-up img.' + co ).is(":visible")){
            	$('.pop-up').fadeOut();
            }else{
            	$('.pop-up').attr("aria-labelledby", "img-" + co);
            	$('.pop-up > img').hide();
                $('.pop-up img.' + co ).show();
            }
            
            
    }
    else {
            $('.pop-up').attr("aria-labelledby", "img-" + co);
            $('.pop-up > img').hide();
            $('.pop-up img.' + co ).show();
            $('.pop-up').fadeIn();
    }
    if ( $(window ).scrollTop() > $('.pop-up' ).offset().top ){
        ScrollTo( $('.pop-up' ) );
    }
    event.preventDefault();
}

function ScrollTo( el ) {
    $('html, body').animate({
        scrollTop: el.offset().top
    }, 500);
}
