$(function() {
    //Wysoki kontrast
    if ($('.top-menu .contrast').length > 0) {
        
        //Detekcja kontrastu z Windows
        if ($.highContrast()) {
            $('body').addClass('high-contrast');
            ga('send', 'event', 'Wysoki kontrast', 'Odslona - Systemowy wysoki kontrast');
        } 
        else {
            $('body').removeClass('high-contrast');
        }
        
        if ( $.cookie("high-contrast") === "true"  ) {
            $('body').addClass('high-contrast');
        }
        $('.top-menu .contrast').click(function(event){
            $.cookie("high-contrast", $('body').toggleClass('high-contrast').hasClass('high-contrast'));
            if ( $('body').hasClass('high-contrast') ) {
                ga('send', 'event', 'Wysoki kontrast', 'wlaczenie');
                ga('send', 'event', 'Wysoki kontrast', 'Odslona - wysoki kontrast');
            } else {
                ga('send', 'event', 'Wysoki kontrast', 'wylaczenie');
                ga('send', 'event', 'Wysoki kontrast', 'Odslona - normalny kontrast');
            }
            event.preventDefault();
        });
        
        if ( $('body').hasClass('high-contrast') ) {
            ga('send', 'event', 'Wysoki kontrast', 'Odslona - wysoki kontrast');
        } else {
            ga('send', 'event', 'Wysoki kontrast', 'Odslona - normalny kontrast');
        }
    }
    
    //PowiÄkszanie i zmniejszanie czcionki
    if ($('.font-size').length > 0) {
        if ( $.cookie("wielkosc-liter") !== undefined ){
            $('body').css({ 'font-size': $.cookie("wielkosc-liter") });
       };
        
        $('.font-size .font-minus').click(function(event){
            var s  = parseInt($('body').css('font-size'), 10);
            if ( s > 16 ) {
                $.cookie("wielkosc-liter", $('body').css({'font-size': '-=1'}).css('font-size'));
                s--;
            }
            ga('send', 'event', 'Rozmiar czcionki', 'Zmniejszenie', s);
            event.preventDefault();
        });
        $('.font-size .font-standard').click(function(event){
              $('body').css({'font-size': ''});
              $.removeCookie("wielkosc-liter");
              ga('send', 'event', 'Rozmiar czcionki', 'Rozmiar normalny');
              event.preventDefault();
        });
        $('.font-size .font-plus').click(function(event){
            var s  = parseInt($('body').css('font-size'), 10);
            if ( s < 26 ) {
                $.cookie("wielkosc-liter", $('body').css({'font-size': '+=1'}).css('font-size'));
                s++;
            }
            ga('send', 'event', 'Rozmiar czcionki', 'Zwiekszenie', s);
            event.preventDefault();
        });
    }
    
    //SesjaFormularza - po okreÅlonym czasie [sec] pola formularza zostanÄ wyczyszczone
    //Formularz zostanie wyczyszczony po 10min bez aktywnoÅci
    //AktywnoÅÄ to klik myszkÄ lub przyciÅniÄcie dowolnego klawisza na klawiaturze
    var oSesjaFormularza = new SesjaFormularza(600); 
    
    if ( $('.error-icon').length > 0 ) {
            //aktywacja tooltipÃ³w
            $('.error-icon').qtip({
                    position: {
                            my: 'bottom left',  // Position my top left...
                            at: 'top left', // at the bottom right of...
                            viewport: $('.main')
                    },
                    style: {
                            classes: 'qtip-plain ui-tooltip-shadow'
                    },
                    show: {
                            event: 'mouseenter'
                    },
                    hide: {
                            event: 'mouseleave click'
                    }
            });
    }

    if ( $('.pop-up').length > 0 ) {
            //Okienko z dowodem rejestracynym
            $('.pop-up').click(function(){
                    $(this).fadeOut();
                    return false;
            });
    }
    if ( $('.form.historia-pojazdu').length > 0 ){
            //Placeholder dla IE
            $('input, textarea').placeholder();

            //Tylko litery i cyfry
            $("input.field.rej").poprawnyNrRejestracyjny();
             $('input.field.vin').alphanumeric({allow:"-<>"});
            //Maska daty
            $('input.field.data').mask("99.99.9999");

            //Obiekt sterujÄcy formularzem
            oFormularzHistoriaPojazdu = new FormularzHistoriaPojazdu();
    }
    
    //Nawigacja w raporcie
    if ( $('.nav-raport').length > 0 ){
        $('.nav-raport .btn').click(function(event){
            $('.nav-raport .btn').removeClass('state-active');
            $(this).addClass('state-active');

            if ($(this).hasClass('btn-timeline')){
                $('.box-information').hide();
                $('.box-timeline').show();
            }
            else {
                $('.box-information').show();
                $('.box-timeline').hide();
            }
            event.preventDefault();
        });
    }
    
    //ZapamiÄtanie aktywnej zakÅadki przy zmianie jÄzyka
    if ( $('.nav-raport').length > 0 ){
        $('.top-menu .english a').click(function(){
            var $navActive =$('nav.nav-raport a.state-active');
            if ($navActive.hasClass('btn-timeline')) {
                sessionStorage.setItem('timelineTabActive',1);
            };
        });

    }

    //Komunikat cookies
    (function(){
        if ( $.cookie("cookie_agree") === undefined ){
            $('#cookie_agree').show();
            var h = $('#cookie_agree').outerHeight();
            $('body').css({'padding-bottom':'+=' + h});
            $('#cookie_agree p .zamknij').click(function(){
                $.cookie("cookie_agree", "1" , { expires: 3650 });
                $('#cookie_agree').hide();
                $('body').css({'padding-bottom':''});
                return false;
            });
        }
    })();
    //Komunikat o braku obsÅugi cookies
    $.cookie("ciasteczka","true");
    if ( $.cookie("ciasteczka") === undefined ) {
        $('.technical-information.cookies-disabled').show();
        ga('send', 'event', 'Komunikat techniczny', 'Brak cookies');
    }
    ///Komunikat o braku obsÅugi cookies
    
    //Statystyki google dla raportu PDF
    if ( $('.btn-pdf-wrapper a').length ) {
        $('.btn-pdf-wrapper a').click(function(){
            ga('send', 'pageview',  window.location.pathname + '/PDF');
        });
    }

    //WyczyÅci dane formularza z cookies jeÅ¼eli zostanie wyÅwietlony raport
    if ($('.raport-header-wrapper').length && !$(".warning-raport").length) {
        $.cookie("rej", '');
        $.cookie("vin", '');
        $.cookie("data", '');
        $.removeCookie("noResult");
    }

    //PrzejÅcie do aktywnej zakÅadki po zmianie jÄzyka
    if ($('.nav-raport').length){
        var timelineTabActive=sessionStorage.getItem('timelineTabActive');
        if (timelineTabActive) {
            $('.nav-raport .btn-timeline').click();
            sessionStorage.removeItem('timelineTabActive');
        }
    }
    
    poprawLinkDoZmianyJezyka();
    zaznaczajPolaFormularzaPoKliknieciu();
    ustawAtrybutTitleWLinkuJezyka();
});

FormularzHistoriaPojazdu = function () {
    var $form = $('.form.historia-pojazdu');

    $('input.field.captchaAnswer').val("");

    $('input.field.rej, input.field.vin, input.field.data').keypress(function(e) {
        if (e.which === 13) {
            $(this).blur();
            $('.btn-sprawdz').trigger('click');
        }
    });

    $('input.field.rej').blur(function() {
        sprawdzDlugosc('rej', 4) ? $(this).siblings('.error-icon').qtip('hide') : $(this).siblings('.error-icon').qtip('show');
    });

    $('input.field.vin').blur(function() {
        sprawdzDlugosc('vin', 1) ? $(this).siblings('.error-icon').qtip('hide') : $(this).siblings('.error-icon').qtip('show');
    });

    $('input.field.data').blur(function() {
        sprawdzDate('data') ? $(this).siblings('.error-icon').qtip('hide') : $(this).siblings('.error-icon').qtip('show');
    });

    //Sprawdza czy input ma l lub wiÄcej znakÃ³w
    var sprawdzDlugosc = function(inputName, l) {
        var $input = $('input.field.' + inputName, $form);
        var inputVal = $input.val();

        if ( inputVal.length < l ) {
            $input.parent('.row').addClass('error').removeClass('ok');
            ga('send', 'event', 'Blad walidacji', inputName, inputVal);
            return false;
        }
        else {
            $input.parent('.row').removeClass('error').addClass('ok');
            return true;
        }
    };

    var sprawdzDate = function(inputName) {
        var $input = $('input.field.' + inputName, $form);
        var dataString = $input.val();

        //Sprawdzenie czy podana data jest datÄ
        try {
            var data = $.datepicker.parseDate('dd.mm.yy', dataString);
        }
        catch (err) {
            data = null;
        }

        //Sprawdzenie czy data zostaÅa podana i czy nie jest z przyszÅoÅci
        if (data === null || data > new Date()) {
            $input.parent('.row').addClass('error').removeClass('ok');
            ;
            ga('send', 'event', 'Blad walidacji', 'Data rejestracji', data);
            return false;
        }
        else {
            $input.parent('.row').removeClass('error').addClass('ok');
            ;
            return true;
        }
    };

    var pokazKomunikaty = function() {
        $('.error-icon').qtip('hide');
        setTimeout(function() {
            $('.error .error-icon').qtip('show');
        }, 300);
    };

    this.clearForm = function(){
        $.cookie("rej", '');
        $.cookie("vin", '');
        $.cookie("data", '');
        $('input.field.rej').val("");
        $('input.field.vin').val("");
        $('input.field.data').val("");
        $('input.field.captchaAnswer').val("");
        $('.error .error-icon').qtip('hide');
        $('input.field.rej, input.field.vin, input.field.data').parent('.row').removeClass('error').removeClass('ok');
    };
    
    $('.btn-sprawdz', $form).click(function() {
        var formularzPoprawny = true;

        formularzPoprawny = sprawdzDlugosc('rej', 4) && formularzPoprawny;
        formularzPoprawny = sprawdzDlugosc('vin', 1) && formularzPoprawny;
        formularzPoprawny = sprawdzDate('data') && formularzPoprawny;
        //formularzPoprawny = sprawdzRegulamin() && formularzPoprawny;

        if (formularzPoprawny) {
           //Walidacja poprawna - wyÅwietl formularz

            $('body').css({'cursor':'wait'});
            $(this).addClass('disabled');

            return true;
        }
        
        //WyÅwietlenie tooltip'Ã³w z komunikatami bÅÄdu
        pokazKomunikaty();

        return false;
    });
};

SesjaFormularza = function( duration ) {
    //timer
    var _tSesja;
    var _d = duration * 1000;
    
    var clearForm = function() {
        //console.log('Sesja wygasÅa - wyczyÅÄ formularz');
        $.cookie("rej", '');
        $.cookie("vin", '');
        $.cookie("data", '');
        if ( $('.form.historia-pojazdu').length > 0 ){
           $('input.field.rej').val("");
            $('input.field.vin').val("");
            $('input.field.data').val("");
            $('.error .error-icon').qtip('hide');
            $('input.field.rej, input.field.vin, input.field.data').parent('.row').removeClass('error').removeClass('ok');
            //$('input[name=reg]').parents('.reg').removeClass('error').removeClass('ok');
        }
        _tSesja = setTimeout( function(){clearForm();} , _d);
    };
    
    //Constructor
    _tSesja = setTimeout( function(){clearForm();} , _d );
    $(document).bind('click keypress', function(){
        //console.log('AktuwnoÅÄ - sesja od poczÄtku');
        clearTimeout(_tSesja);
        _tSesja = setTimeout( function(){clearForm();}, _d);
    });
};

